import {BrowserRouter,Routes,Route} from 'react-router-dom'

import AddTask from './pages/AddTask';
import Task from './pages/Task';
import AssignedBy from './pages/AssignedBy';
import AssignedTo from './pages/AssignedTo';
import SharedLayout from './pages/SharedLayout';
import Login from './pages/Login';
function App() {


  return (
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Login/>}/>

          <Route path='user' element={<SharedLayout/>}>

            <Route index element={<AddTask/>}/>
            <Route path='task' element={<Task/>}/>
            <Route path='assignedby' element={<AssignedBy/>}/>
            <Route path='assignedto' element={<AssignedTo/>}/>

          </Route>

        </Routes>
      </BrowserRouter>
  );
}

export default App;
